import axios from "axios";
import React, { useState, useEffect, Component } from "react";
import { useParams } from "react-router-dom";

function QuestionUnanswered() {
	const questionIdParam = useParams();
	console.log(questionIdParam)
	const questionId = String(questionIdParam);
	console.log("QuestionUnanswered");
	console.log(questionId);

	useEffect(() => {
		axios
			.get("/question/" + questionId + "/unanswered/user")
			.then((res) => {
				console.log(res.data);
				// setQuestionList(res.data);
			})
			.catch((err) => {
				console.log(err);
			});
	}, [questionId]);

	return (
		<>
			<div>quesiton 고유페이지입니다.</div>
		</>
	);
}

export default QuestionUnanswered;
